    <script>

        function PegarMoedas(dados) {
            var quantidade = 0;
            var moedas = [];
            while (quantidade < dados.length) {
                moedas.push(dados[quantidade].nome);
                quantidade++;
            }

            return moedas;
        }

        function PegarQuantidade(dados) {
            var quantidade = 0;
            var valores = [];
            while (quantidade < dados.length) {
                valores.push(dados[quantidade].nome);
                quantidade++;
            }

            return valores;
        }

        function PegarCores(quantidade) {
            var cores = [];
            while (quantidade >= 0) {
                var r = Math.floor(Math.random() * 255);
                var g = Math.floor(Math.random() * 255);
                var b = Math.floor(Math.random() * 255);

                cores.push(""rgb("" + r + "","" + g + "","" + b + "")"");
                quantidade--;
            }

       ");
